        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24">  <rect width="24" height="24" fill="#b9a78e"/>  <rect x="4.5" y="4.5" width="15" height="3" fill="none" stroke="#fff" stroke-miterlimit="10"/>  <rect x="4.5" y="10.5" width="15" height="3" fill="none" stroke="#fff" stroke-miterlimit="10"/>  <rect x="4.5" y="16.5" width="6" height="3" fill="none" stroke="#fff" stroke-miterlimit="10"/>  <rect x="13.5" y="16.5" width="6" height="3" fill="none" stroke="#fff" stroke-miterlimit="10"/>  <line x1="7.25" y1="14" x2="7.25" y2="16" fill="none" stroke="#fff" stroke-miterlimit="10" stroke-width="0.75"/>  <line x1="12" y1="7.881" x2="12" y2="10.119" fill="none" stroke="#fff" stroke-miterlimit="10" stroke-width="0.75"/>  <line x1="10.867" y1="18.25" x2="13.133" y2="18.25" fill="none" stroke="#fff" stroke-miterlimit="10" stroke-width="0.75"/></svg>';
